import { createRouter, createWebHistory } from 'vue-router';
import HomeWeb from './views/HomeWeb.vue';
import AboutWeb from './views/AboutWeb.vue';

const routes = [
    {
        path: '/',
        name: 'HomeWeb',
        component: HomeWeb,
      },
      {
        path: '/AboutWeb',
        name: 'AboutWeb',
        component: AboutWeb,
      },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
